const gradeName = ['一年', '二年', '三年', '四年', '五年', '六年', undefined, '中学ー大学', '人名用', '人名用'];

(async () => {
    // get item data from wkof
    wkof.include('ItemData');
    const itemData = await wkof.ready('ItemData').then(() => wkof.ItemData.get_items());

    // find out if page is lesson, review, or word info
    const pageType = window.location.pathname.includes('lesson') ? 'lesson' : (window.location.pathname.includes('review') ? 'review' : (window.location.pathname.includes('extra_study') ? 'extra_study' : 'info'));

    // "await existence of element"-function
    const awaitElement = (id) => new Promise(resolve => { // wait until character element exists
        if (document.getElementById(id)) return resolve(document.getElementById(id));
        const observer = new MutationObserver((mutations) => { // observer for existence
            if (document.getElementById(id)) {
                resolve(document.getElementById(id));
                observer.disconnect();
            }
        });
        observer.observe(document.body, { childList: true, subtree: true });
    });

    // filter out superfluous item parts
    const filterItemName = (name) => {
        const exceptions = ['五感'];
        if (exceptions.includes(name)) return name; // don't mess with exceptions
        if (name.slice(-2) == 'する') return name.slice(0, -2); // suru verbs to noun stem
        if (name[0] == '〜') return name.slice(1); // counters without ~
        const nameNumberless = name.match(/[^\u4e00\u4e8c\u4e09\u56db\u4e94\u516d\u4e03\u516b\u4e5d\u5341\u767e\u5343\u4e07\u842c\u5104\u4ebf\u5146\uff10-\uff20]/g);
        if (nameNumberless !== null && !(nameNumberless.join('') != name && name.slice(-1) == '月')) return nameNumberless.join(''); // remove numbers (except for months)
        const nameOnlyjapanese = name.match(/[\u3040-\u309f\u30a0-\u30ff\uff00-\uff9f\u4e00-\u9faf\u3400-\u4dbf]/g);
        if (nameOnlyjapanese !== null) return nameOnlyjapanese.join(''); // remove romaji or other stuff (dunno if this is necessary)
        return name; // if everything fails just return the normal name
    }

    // data get and format functions
    const addLine = (label, value, infoPage) => infoPage ? '<div class="alternative-meaning"><h2>' + label + '</h2><p class="text-gray-700">' + value + '</p></div>' : '<span style="font-weight: bold;">' + label + '</span><span style="padding-left: 10px;">' + value + '</span>';
    const typeData = async (itemType, itemName, infoPage = false) => {
        // type-specific data
        var htmlStr = '';
        var info, grade, top, jlpt, joyo, freq, num, strokes, origin;
        switch (itemType) {
            case 'k': // kanji
                // get data (from kanjiapi.dev if not available in dict)
                info = kanjiInfo.hasOwnProperty(itemName) ? kanjiInfo[itemName] : await fetch('https://kanjiapi.dev/v1/kanji/' + itemName).then(e => e.json()).then(e => [e.grade, null, e.jlpt]);
                grade = info[0] == null ? 'Not taught in schools' : gradeName[info[0] - 1];
                top = info[1] == null ? 'Not in top 2500' : '#' + info[1];
                jlpt = info[2] == null ? 'Not in JLPT' : 'N' + info[2];
                joyo = joyoKanji.includes(itemName) ? 'Yes' : 'No';
                // set info box content
                htmlStr += addLine('Grade', grade, infoPage);
                htmlStr += addLine('Top', top, infoPage);
                htmlStr += addLine('JLPT', jlpt, infoPage);
                htmlStr += addLine('Joyo', joyo, infoPage);
                break;
            case 'v': // vocab
                const filteredName = filterItemName(itemName); // filter out junk
                //const chars = filteredName.match(/[\u4e00-\u9faf\u3400-\u4dbf]/g);
                // get data
                info = wordInfo[filteredName];
                top = info == null || info[0] == null ? 'Not in top 15000' : '#' + info[0];
                freq = info == null || info[1] == null ? 'Not in top 15000' : (info[1] / totalWordCount * 100).toFixed(3) + '%';
                common = info == null || info[3] == null ? undefined : (info[3] ? 'Yes' : 'No');
                jlpt = info == null || info[2] == null ? undefined : (info[2] == 0 ? 'Not in JLPT' : 'N' + info[2]);
                // set info box content
                htmlStr += addLine('Top', top, infoPage);
                htmlStr += addLine('Freq', freq, infoPage);
                if (common !== undefined) htmlStr += addLine('Common', common, infoPage);
                if (jlpt !== undefined) htmlStr += addLine('JLPT', jlpt, infoPage);
                break;
            case 'r': // radical
                // radical names to slug
                const realName = itemData.find(e => e.data.slug == itemName || e.data.characters == itemName).data.characters;
                if (!radicalInfo.hasOwnProperty(realName)) return null; // no information
                // get data
                info = radicalInfo[realName];
                num = info[1] == null ? 'Not numbered' : info[1];
                top = info[0] == null ? 'Not in top 214' : '#' + info[0];
                strokes = info[2] == null ? undefined : info[2];
                origin = info[3] == null ? undefined : info[3];
                // set info box content
                htmlStr += addLine('No.', num, infoPage);
                htmlStr += addLine('Top', top, infoPage);
                if (strokes !== undefined) htmlStr += addLine('Strokes', strokes, infoPage);
                if (origin !== undefined) htmlStr += addLine('Origin', origin, infoPage);
                break;
            default:
                return undefined;
        }
        return htmlStr;
    };

    if (pageType == 'info') { // kanji/vocab/radical info page
        // get kanji details
        const itemType = window.location.pathname.split('/')[1][0].toLowerCase();
        const itemName = decodeURIComponent(window.location.pathname.split('/')[2]);
        const htmlStr = await typeData(itemType, itemName, true);

        if (htmlStr !== null && htmlStr !== undefined) { // fill info in
            var template = document.createElement('template');
            template.innerHTML = '<section id="info" class="remove-margin-bottom"><h2>Information</h2>' + htmlStr + '</section>';
            document.getElementById(itemType == 'r' ? 'information' : 'meaning').before(template.content.firstChild);
        }

    } else { // extra study, lesson, or review page
        // put loading and timeout screens (and all the others) above info box
        if (pageType === 'lesson') {
            awaitElement('loading-screen').then(e => e.style.zIndex = 10001);
            awaitElement('screen-lesson-done').then(e => e.style.zIndex = 10001);
            awaitElement('screen-lesson-ready').then(e => e.style.zIndex = 10001);
            awaitElement('screen-quiz-ready').then(e => e.style.zIndex = 10001);
        } else awaitElement('loading').then(e => e.style.zIndex = 10001);
        awaitElement('timeout').then(e => e.style.zIndex = 10001);

        // figure out the details of this sucker
        const characterElement = await awaitElement('character');

        // add kanji info box
        var template = document.createElement('template');
        template.innerHTML = '<div id="wk-kanji-info" style="position: absolute;top: 50px;left: 20px;background-color: rgba(239, 239, 239, 0.75);border-radius: 3px;padding: 8px 12px;color: rgba(0, 0, 0, 0.7);font-size: .83em;text-align: left;display: grid;grid-template: 1fr / auto 1fr;z-index: 10000"></div>';
        await awaitElement('question').then(e => { e.prepend(template.content.firstChild); e.children[1].style.zIndex = 10001; });

        // update kanji info box function
        const updateKanjiInfo = async function () {
            // show info box
            document.getElementById('wk-kanji-info').style.display = 'grid';
            // get item details
            const itemType = pageType === 'lesson' ? characterElement.parentNode.className[0].toLowerCase() : characterElement.className[0].toLowerCase();
            const itemName = pageType === 'lesson' ? characterElement.innerHTML : characterElement.children[0].innerHTML;
            const item = itemData.find(e => e.data.slug == itemName || e.data.characters == itemName);
            if (item === undefined) { document.getElementById('wk-kanji-info').style.display = 'none'; return; }
            var htmlStr = '';
            // add level data
            const level = item.data.level;
            htmlStr += addLine('Level', level);

            // type-specific data
            const typeHtml = await typeData(itemType, itemName);
            if (typeHtml === undefined) document.getElementById('wk-kanji-info').style.display = 'none'; // hide info box
            htmlStr += typeHtml == null ? '' : typeHtml;

            // fill in data
            document.getElementById('wk-kanji-info').innerHTML = htmlStr;
        };

        // set info box contents for first item
        updateKanjiInfo();

        // setup observer to change info box contents for subsequent items
        var observer = new MutationObserver((mutations) => updateKanjiInfo());
        var config = { attributes: true, childList: true, characterData: true };
        observer.observe(characterElement, config);
    }
})();